import imgProduct01 from "../../images/image-product-1.jpg";
import thmb01 from "../../images/image-product-1-thumbnail.jpg";
import thmb02 from "../../images/image-product-2-thumbnail.jpg";
import thmb03 from "../../images/image-product-3-thumbnail.jpg";
import thmb04 from "../../images/image-product-4-thumbnail.jpg";

const Product = () => {
  return (
    <div className="product box-border bg-blue-3 px-20 pt-14 pb-8">
      <img src={imgProduct01} alt="image-product" className=" rounded-2xl mb-6 mx-auto" />
      <ul className="thumbnails flex justify-between ">
        <li className="group outline rounded-lg overflow-hidden outline-transparent active:outline-primary-1 outline-2 w-1/5">
          <img src={thmb01} alt="thumbnail-1 " className="rounded-lg group-hover:opacity-30" />
        </li>
        <li className="group outline rounded-lg overflow-hidden outline-transparent active:outline-primary-1 outline-2 w-1/5">
          <img src={thmb02} alt="thumbnail-2 " className="rounded-lg group-hover:opacity-30" />
        </li>
        <li className="group outline rounded-lg overflow-hidden outline-transparent active:outline-primary-1 outline-2 w-1/5">
          <img src={thmb03} alt="thumbnail-3 " className="rounded-lg group-hover:opacity-30" />
        </li>
        <li className="group outline rounded-lg overflow-hidden outline-transparent active:outline-primary-1 outline-2 w-1/5">
          <img src={thmb04} alt="thumbnail-4 " className="rounded-lg group-hover:opacity-30" />
        </li>
      </ul>
    </div>
  );
};

export default Product;
